import React from 'react'

const Header = (course) =>{
  return(
    <>
    <h1>{course.name}</h1>
    </>)
}
const Part = (part) =>{
  return(
    <>
      <p>
        {part.name} {part.exercises}
      </p>
    </>
  )
}
const Content = (content) =>{
    <>
      <Part name = {content[0].name} exercises = {content[0].exercises} />
      <Part name = {content[1].name} exercises = {content[1].exercises} />
      <Part name = {content[2].name} exercises = {content[2].exercises} />
    </>
}
const Total = (n) =>{
  return(
    <>
    <p>
      Number of exercises {n.num}
    </p>
    </>
  )

}
const App = () => {
  const course = 'Half Stack application development'
  const part1 = 'Fundamentals of React'
  const exercises1 = 10
  const part2 = 'Using props to pass data'
  const exercises2 = 7
  const part3 = 'State of a component'
  const exercises3 = 14

  return (
    <div>
      <Header name={course} />
      <Content  name = {part1} exercises = {exercises1}/>
      <Content  name = {part2} exercises = {exercises2}/>
      <Content  name = {part3} exercises = {exercises3}/>
      <Total  num = {exercises1 + exercises2 + exercises3}/>
    </div>
  )
}

export default App
